sys_variable_value.value:
(function execute(inputs, outputs) {
  	var returnArray = [];
  	var dataJSON = inputs.jsonData["data"];
	for (i=0;i<dataJSON.length;i++){
    	var returnObj = {
      		'company' : dataJSON[i].attributes["team-name"],
          	'teamID' : dataJSON[i].attributes["team-id"],
          	'id' : dataJSON[i].id,
          	'createdAt' : dataJSON[i].attributes["created-at"].replace('T', ' '),
          	'completedAt' : dataJSON[i].attributes["completed-at"].replace('T', ' '),
          	'primaryContactName' : dataJSON[i].attributes["application-contributors"][0].name,
          	'primaryContactEmail' : dataJSON[i].attributes["application-contributors"][0].email
		}
        returnArray.push(JSON.stringify(returnObj));
    }
  	outputs.submissiondata = returnArray;

})(inputs, outputs);

